"""Detta Python-skript laddar ner och bearbetar en lista över Sveriges kommuner och deras respektive länskoder från en offentligt tillgänglig Excel-fil på GitHub. Skriptet använder biblioteket `pandas` för att hantera data i form av DataFrames, vilket gör det möjligt att effektivt läsa, transformera och manipulera stora mängder data.

Först definieras funktionen `get_municipalities_from_github()`, som hämtar och bearbetar datan. Den använder en direkt URL till den råa Excel-filen på GitHub för att ladda ner datan. Datan läses in direkt från URL:en med hjälp av `pandas` funktion `read_excel`. Därefter anpassas dataramen genom att sätta om kolumnnamnen till 'Kod' och 'Namn', och onödiga rader tas bort baserat på logiken i det ursprungliga skriptet.

Funktionen itererar sedan genom varje rad i dataramen för att skapa en ny dataram med kommuner, deras koder och motsvarande län. Detta görs genom att kontrollera om koden består av fyra siffror (vilket indikerar en kommun), extrahera den relevanta länkoden och till sist matcha den med rätt länsnamn. Om ingen matchning hittas sätts länsnamnet till "Unknown".

Resultatet är en ny `DataFrame` som innehåller en lista över kommuner med deras koder och motsvarande län. Skriptet avslutas med att köra funktionen och visa de första raderna i den resulterande dataramen, vilket ger en överblick över datan.

Detta skript kan vara användbart för att dynamiskt hämta och uppdatera information om Sveriges kommuner och län, vilket kan vara värdefullt i olika samhällsplanerings- och analysprojekt.
"""

import pandas as pd

def get_municipalities_from_github():
    # Direct URL to the Excel file in raw format on GitHub
    url = 'https://raw.githubusercontent.com/Klimatbyran/klimatkollen/staging/data/facts/kommunlankod_2023.xls'

    # Load the data directly from the URL
    df = pd.read_excel(url)

    # Set column names to 'Kod' and 'Namn' assuming they are in the first row after the header
    df.columns = ['Kod', 'Namn']

    # Drop unnecessary rows based on the original script's logic
    df = df.drop([0, 1, 2, 3, 4], axis=0).reset_index(drop=True)

    # Create an empty dataframe to store the result
    result = pd.DataFrame(columns=['Kommun', 'Kod', 'Län'])

    # Iterate through the rows of the dataframe
    for _, row in df.iterrows():
        if len(row['Kod']) == 4:  # Check if it is a four-digit code row
            code = row['Kod']
            municipality = row['Namn']
            # Lookup the county (Län) based on the two-digit code
            county = df.loc[df['Kod'] == code[:2], 'Namn'].values[0] if df.loc[df['Kod'] == code[:2], 'Namn'].values.size > 0 else "Unknown"
            # Append a new row to the 'result' DataFrame
            result = pd.concat([result, pd.DataFrame({'Kommun': [municipality], 'Kod': [code], 'Län': [county]})], ignore_index=True)

    # Return the resulting dataframe
    return result

# Run the function and display the first few rows
result_df = get_municipalities_from_github()
result_df.head()

