"""
Skript för att skära ut NDVI-data för Stockholms kommun från en större NDVI-raster.

Steg 1: Läs in kommungränsen för Stockholm från en GeoPackage-fil.
Steg 2: Kontrollera och justera koordinatsystemet för NDVI-rasterdata.
Steg 3: Skapa en maskerad utsnitt av NDVI-raster med kommungränsen som mask.
        Områden utanför kommungränsen visas som NaN (NA).
Steg 4: Spara det utsnittna raster som en ny GeoTIFF-fil.
Steg 5: Visualisera det utsnittna NDVI-raster med NaN-värden (vita) utanför kommungränsen.
"""

# Steg 1: Läs in kommungränsen för Stockholm från en GeoPackage-fil
kommungrans_file = 'https://github.com/soleildeminuit/AI-Samhallsplanering-Course/raw/main/data/raw/Stockholm_Kommun_WGS84.gpkg'
kommungrans_gdf = gpd.read_file(kommungrans_file)

# NDVI-rasterdata filväg
ndvi_file_path = 'https://github.com/soleildeminuit/AI-Samhallsplanering-Course/raw/main/data/raw/2023-05-18-00_00_2023-05-18-23_59_Sentinel-2_L2A_Custom_script.tiff'

# Steg 2: Kontrollera och justera koordinatsystemet för NDVI-rasterdata
with rasterio.open(ndvi_file_path) as src:
    raster_crs = src.crs
    if kommungrans_gdf.crs.to_string() != raster_crs.to_string():
        kommungrans_gdf = kommungrans_gdf.to_crs(raster_crs)

# Steg 3: Skapa en maskerad utsnitt av NDVI-raster med kommungränsen som mask
with rasterio.open(ndvi_file_path) as src:
    out_image, out_transform = mask(src, kommungrans_gdf.geometry, crop=True,
                                    filled=True, nodata=np.nan)
    out_meta = src.meta

# Uppdatera metadatan för det utsnittna raster
out_meta.update({"driver": "GTiff",
                 "height": out_image.shape[1],
                 "width": out_image.shape[2],
                 "transform": out_transform})

# Steg 4: Spara det utsnittna raster som en ny GeoTIFF-fil
clipped_raster_nan_bg_file = '/content/sample_data/Clipped_NDVI_Stockholm_NaN_BG.tiff'
with rasterio.open(clipped_raster_nan_bg_file, "w", **out_meta) as dest:
    dest.write(out_image)

# Steg 5: Visualisera det utsnittna NDVI-raster
with rasterio.open(clipped_raster_nan_bg_file) as src:
    clipped_ndvi_nan_bg = src.read(1)  # Läs det första bandet (NDVI)

    # Skapa figur för visualisering
    fig, ax = plt.subplots(figsize=(10, 10))
    ndvi_image = ax.imshow(clipped_ndvi_nan_bg, cmap='RdYlGn', vmin=0, vmax=1)
    ax.set_title('NDVI - Stockholm Grönytor (med NaN-värden utanför kommungräns)')
    ax.axis('off')
    fig.colorbar(ndvi_image, ax=ax, shrink=0.5, label='NDVI')

plt.show()

