"""
Kartläggning av Urbana Värmeöar i Stockholm

1. Ladda och bearbeta rasterdata (GeoTIFF) som representerar värmedata över Stockholm.
2. Tillämpa en temperaturtröskel för att identifiera urbana värmeöar.
3. Omvandla de identifierade värmeöarna till polygoner.
4. Ladda in gränsdata för Stockholms kommun från en GeoPackage-fil.
5. Omprojicera värmeödata för att matcha koordinatsystemet (CRS) för gränsdata.
6. Klipp ut värmeödata till Stockholms kommuns gränser.
7. Plotta och visuellt inspektera de urbana värmeöarna inom kommunen.
8. Spara den utklippta värmeödatan som en ny GeoPackage-fil.
"""
# Kontrollerar och installerar nödvändiga bibliotek
import subprocess
import sys

# Lista med paket som ska installeras
paketen = ["numpy", "rasterio", "geopandas", "matplotlib", "shapely"]

# Försök importera paketen, installera om de saknas
for paket in paketen:
    try:
        __import__(paket)
    except ImportError:
        subprocess.check_call([sys.executable, "-m", "pip", "install", paket])

# Importera efter eventuell installation
import numpy as np
import rasterio
import rasterio.features
import geopandas as gpd
import matplotlib.pyplot as plt
from shapely.geometry import shape

# File paths
raster_file = "https://github.com/soleildeminuit/AI-Samhallsplanering-Course/raw/main/data/raw/Stockholm_2017_2022.tif"  # Replace with your file path
boundary_file = "https://github.com/soleildeminuit/AI-Samhallsplanering-Course/raw/main/data/raw/Stockholm_Kommun.gpkg"  # Replace with your file path

# Load and read the raster data
with rasterio.open(raster_file) as src:
    transform = src.transform
    array = src.read(1)

# Threshold for urban heat islands
threshold_temperature = 35

# Create a mask and extract polygons
mask = array > threshold_temperature
polygons = [
    shape(geom)
    for geom, value in rasterio.features.shapes(mask.astype(np.uint8), transform=transform)
    if value == 1
]

# Convert polygons to a GeoDataFrame
heat_island_gdf = gpd.GeoDataFrame(geometry=gpd.GeoSeries(polygons), crs=src.crs)

# Load the boundary data
boundary_gdf = gpd.read_file(boundary_file)

# Reproject the heat island data to match the CRS of the boundary data
heat_island_gdf_reprojected = heat_island_gdf.to_crs(boundary_gdf.crs)

# Clip the heat island data to the boundary of Stockholm Municipality
clipped_heat_island_gdf = gpd.clip(heat_island_gdf_reprojected, boundary_gdf)

# Plotting
fig, ax = plt.subplots(figsize=(10, 10))
boundary_gdf.boundary.plot(ax=ax, color='black')
clipped_heat_island_gdf.plot(ax=ax, color='red', alpha=0.5)
plt.title("Urban Heat Islands within Stockholm Municipality")
plt.show()

# Save the clipped data as a GeoPackage file
output_file = "/content/sample_data/Stockholm_Heat_Islands_Clipped.gpkg"  # Replace with your desired output path
clipped_heat_island_gdf.to_file(output_file, driver="GPKG")

