"""
Analysera Förskolors Exponering för Urbana Värmeöar i Stockholm

Detta skript genomför följande steg:
1. Importera nödvändiga bibliotek (geopandas, matplotlib).
2. Ladda GeoPackage-filer innehållande data om förskolor, urbana värmeöar, och Stockholms kommuns gräns.
3. Filtrera förskolor som ligger inom Stockholms kommun.
4. Identifiera förskolor som ligger inom urbana värmeöar.
5. Skapa och visa en karta som illustrerar förskolor inom urbana värmeöar i Stockholm.

Syftet med skriptet är att visualisera och analysera hur förskolor i Stockholm är exponerade för urbana värmeöar,
vilket är viktigt för planering och genomförande av åtgärder för att minska värmeöarnas negativa effekter.
"""

# Kontrollerar och installerar nödvändiga bibliotek
import subprocess
import sys

paketen = ["geopandas", "matplotlib"]

for paket in paketen:
    try:
        __import__(paket)
    except ImportError:
        subprocess.check_call([sys.executable, "-m", "pip", "install", paket])

# Importera efter eventuell installation
import geopandas as gpd
import matplotlib.pyplot as plt

forskolor_path = 'https://github.com/soleildeminuit/AI-Samhallsplanering-Course/raw/main/data/raw/Forskolor_ht23_sweref.gpkg'
heat_islands_path = 'https://github.com/soleildeminuit/AI-Samhallsplanering-Course/raw/main/data/raw/Stockholm_Heat_Islands_Clipped_Final.gpkg'
stockholm_boundary_path = 'https://github.com/soleildeminuit/AI-Samhallsplanering-Course/raw/main/data/raw/Stockholm_Kommun.gpkg'

forskolor_gdf = gpd.read_file(forskolor_path)
heat_islands_gdf = gpd.read_file(heat_islands_path)
stockholm_boundary_gdf = gpd.read_file(stockholm_boundary_path)

# Steg 2: Filtrera förskolor som ligger inom Stockholms kommun
forskolor_in_stockholm = forskolor_gdf[forskolor_gdf.within(stockholm_boundary_gdf.unary_union)]

# Steg 3: Filtrera förskolor som ligger inom urbana värmeöar
forskolor_in_heat_islands = forskolor_in_stockholm[forskolor_in_stockholm.within(heat_islands_gdf.unary_union)]

# Steg 4: Skapa en karta som visar förskolor inom värmeöar
fig, ax = plt.subplots(figsize=(10, 10))
stockholm_boundary_gdf.plot(ax=ax, color='none', edgecolor='black') # Ritar kommungränsen
heat_islands_gdf.plot(ax=ax, color='red', alpha=0.5) # Ritar urbana värmeöar
forskolor_in_heat_islands.plot(ax=ax, color='blue', markersize=10) # Ritar förskolor

# Steg 5: Titel och axelbeskrivningar
plt.title('Förskolor i Urbana Värmeöar i Stockholm')
plt.xlabel('Longitude')
plt.ylabel('Latitude')
plt.show()

