import geopandas as gpd
import rasterio
from rasterio.mask import mask
import xml.etree.ElementTree as ET
import numpy as np
import matplotlib.pyplot as plt
import matplotlib.patches as mpatches
import matplotlib.colors as mcolors
import requests

# Filvägar
raster_path = 'https://github.com/soleildeminuit/AI-Samhallsplanering-Course/raw/main/data/raw/AB_lan_nmd2018bas_ogeneraliserad_v1_1.tif'
vector_path = 'https://github.com/soleildeminuit/AI-Samhallsplanering-Course/raw/main/data/raw/Stockholm_Kommun.gpkg'
qml_file = 'https://github.com/soleildeminuit/AI-Samhallsplanering-Course/raw/main/data/raw/nmd2018bas_ogeneraliserad_v1_1.qml'

# Ladda in kommungränsen från GPKG-filen
stockholm_boundary = gpd.read_file(vector_path)

# Klipp raster med kommungränsen
with rasterio.open(raster_path) as src:
    out_image, out_transform = mask(src, stockholm_boundary.geometry, crop=True)
    out_meta = src.meta.copy()

# Uppdatera metadata för den klippta rasterbilden
out_meta.update({"driver": "GTiff",
                 "height": out_image.shape[1],
                 "width": out_image.shape[2],
                 "transform": out_transform})

# Modifierad funktion för att tolka QML-filen
def parse_qml_for_legend_and_colors(qml_url):
    response = requests.get(qml_url)
    if response.status_code != 200:
        raise Exception(f"Kunde inte ladda QML-fil från {qml_url}")
    qml_content = response.content

    tree = ET.ElementTree(ET.fromstring(qml_content))
    root = tree.getroot()

    color_mapping = {}
    legend_items = {}
    for paletteEntry in root.iter('paletteEntry'):
        value = int(paletteEntry.get('value'))
        if value == 0:
            continue
        color = paletteEntry.get('color').lstrip('#')
        label = paletteEntry.get('label')
        rgb_color = tuple(int(color[i:i+2], 16) for i in (0, 2, 4))
        color_mapping[value] = rgb_color
        legend_items[value] = (label, rgb_color)

    return color_mapping, legend_items

color_mapping, legend_items = parse_qml_for_legend_and_colors(qml_file)

# Funktion för att applicera färgmappning på rasterdata
def apply_color_mapping(raster_data, color_map):
    colored_raster = np.zeros((raster_data.shape[1], raster_data.shape[2], 3), dtype=np.uint8)
    for unique_value in np.unique(raster_data):
        if unique_value in color_map:
            mask = raster_data[0] == unique_value
            colored_raster[mask] = color_map[unique_value]
    return colored_raster

colored_clipped_raster = apply_color_mapping(out_image, color_mapping)

# Skapa en kartlegend med endast de använda legendartiklarna
def create_legend(raster_data, legend_items):
    unique_values = np.unique(raster_data)
    patches = [mpatches.Patch(color=np.array(legend_items[value][1])/255.0, label=legend_items[value][0]) for value in unique_values if value in legend_items]
    return patches

legend_patches = create_legend(out_image, legend_items)

# Visa den färglagda kartan med legend
plt.figure(figsize=(14, 14))
plt.imshow(colored_clipped_raster)
plt.title("Färglagd Klippt Raster av Stockholm med Legend")
plt.axis('off')
plt.legend(handles=legend_patches, bbox_to_anchor=(1.05, 1), loc='upper left')
plt.tight_layout()
plt.show()

