tree = ET.ElementTree(ET.fromstring(qml_content))
root = tree.getroot()

palette = {}
label_mapping = {}
...
for palette_entry in root.findall('.//paletteEntry'):
    value = int(palette_entry.get('value'))
    color = palette_entry.get('color')
    label = palette_entry.get('label')
    palette[value] = mcolors.to_rgba(color)  # Ändrad här, ta bort '#' +
    label_mapping[value] = label

# Identifiera och filtrera unika värden i den beskurna bilden, uteslut värden med 0
unique_values = np.unique(out_image)

# Behåll alla unika värden för kartvisualiseringen
filtered_values = unique_values

# Skapa en karta med legend
fig, ax = plt.subplots(figsize=(10, 10))
rioplot.show(out_image[0], cmap=mcolors.ListedColormap([palette.get(value, '#FFFFFF') for value in filtered_values]), transform=out_transform, ax=ax)
ax.set_title("Marktäckeskarta för Södra Högalid")

# Skapa legend, men uteslut värden med 0
legend_labels = [mpatches.Patch(color=palette[value], label=label_mapping.get(value, f"Value {value}")) for value in filtered_values if value in palette and value in label_mapping and value > 0]
ax.legend(handles=legend_labels, bbox_to_anchor=(1.05, 1), loc='upper left')

plt.savefig('sodra_hogalid_land_cover_map_filtered.png', bbox_inches='tight')
plt.show()

