"""
Skript för att Importera och Använda GeoPandas och Folium för Geospatial Analys

Detta skript demonstrerar användningen av GeoPandas för att hantera geospatial data
och Folium för att visualisera denna data på interaktiva kartor. Skriptet inkluderar
även anrop till en WFS-tjänst (Web Feature Service) för att hämta ytterligare geospatial
data över internet.

Processen omfattar:
1. Importera nödvändiga bibliotek.
2. Använda GeoPandas för att hantera geospatial data.
3. Använda Folium för att skapa interaktiva kartvisualiseringar.
4. Hämta och integrera data från en WFS-tjänst.
"""

# Lista med paket som ska installeras
paketen = ["geopandas", "folium", "owslib", "json"]

# Försök importera paketen, installera om de saknas
import subprocess
import sys

for paket in paketen:
    try:
        __import__(paket)
    except ImportError:
        subprocess.check_call([sys.executable, "-m", "pip", "install", paket])

# Importera efter eventuell installation
import geopandas as gpd
import folium
from owslib.wfs import WebFeatureService
import json

# URL och inställningar för WFS-tjänsten
wfs_url = 'https://opendata-view.smhi.se/SMHI_vatten/Huvudavrinningsomraden_2016/wfs?service=wfs&request=getcapabilities'
layer_name = 'SMHI_vatten:Huvudavrinningsomraden_2016'
wfs = WebFeatureService(wfs_url, version='2.0.0')

# Hämta GeoJSON-data från WFS-tjänsten
response = wfs.getfeature(typename=layer_name, outputFormat='application/json')
geojson_data = json.loads(response.read())

# Läs in GeoJSON-data med geopandas
gdf = gpd.GeoDataFrame.from_features(geojson_data['features'])
gdf.crs = "EPSG:3006"
gdf = gdf.to_crs(epsg=4326)

# Skapa en lista med attribut för popup (exkludera 'geometry')
attributes = [col for col in gdf.columns if col != 'geometry']

# Skapa en Folium-karta
m = folium.Map(location=[62, 15], zoom_start=4)

# Definiera en funktion för att skapa popup-innehåll
def make_popup(feature):
    return '<br>'.join([f'{key}: {feature["properties"][key]}' for key in attributes])

# Lägg till GeoJSON-datan på kartan med popups
folium.GeoJson(
    gdf,
    name='Huvudavrinningsområden',
    style_function=lambda x: {'color': 'blue', 'weight': 2},
    tooltip=folium.GeoJsonTooltip(fields=attributes),
    popup=folium.GeoJsonPopup(fields=attributes)
).add_to(m)

# Lägg till ett lagerkontroll
folium.LayerControl().add_to(m)

# Spara kartan
m.save('interactive_map_with_popups.html')

print("Interaktiv karta med popups skapad och sparad som 'interactive_map_with_popups.html'")

m

