import geopandas as gpd
from owslib.wms import WebMapService
import folium
import requests
from io import BytesIO

# URL till WMS-tjänsten och specifikt lagernamn
wms_url = 'https://ext-geodata-lokala.lansstyrelsen.se/arcgis/services/LSTAB/lstab_wms_geodata1/MapServer/WMSServer'
layer_name = 'LstAB_utv_strandskydd_begransningslinjer'

# Skapa en Folium-karta
m = folium.Map(location=[60, 18], zoom_start=5)

# Lägg till WMS-lagret till kartan
wms_layer = folium.raster_layers.WmsTileLayer(
    url=wms_url,
    name=layer_name,
    fmt='image/png',
    layers=layer_name,
    transparent=True
)
wms_layer.add_to(m)
folium.LayerControl().add_to(m)
m.save('wms_karta_strandskydd.html')

# Funktion för att ladda ner geodata från WMS-tjänsten
def download_wms_layer_as_geopackage(wms_url, layer_name, geopackage_path):
    wms = WebMapService(wms_url, version='1.3.0')

    # Hämta information om lagret
    layer = wms[layer_name]
    bbox = layer.boundingBoxWGS84

    # Bygg WMS GetFeatureInfo URL
    wms_getfeatureinfo_url = f"{wms_url}?service=WMS&version=1.3.0&request=GetFeatureInfo&layers={layer_name}&bbox={bbox[0]},{bbox[1]},{bbox[2]},{bbox[3]}&width=800&height=600&info_format=application/json"

    # Skicka förfrågan och ladda ner datat
    response = requests.get(wms_getfeatureinfo_url)
    if response.status_code == 200:
        gdf = gpd.read_file(BytesIO(response.content))
        gdf.to_file(geopackage_path, driver='GPKG')
        print(f"Data sparad som GeoPackage: {geopackage_path}")
    else:
        print("Det gick inte att ladda ner geodata.")

# Ange sökvägen där GeoPackage ska sparas
