import requests

def get_response(url):
    try:
        response = requests.get(url)
        response.raise_for_status()  # Ger ett undantag för HTTP-felkoder
        return response.json()
    except requests.exceptions.HTTPError as http_err:
        print(f"HTTP error occurred: {http_err}")
    except requests.exceptions.RequestException as err:
        print(f"Error occurred: {err}")
    except requests.exceptions.JSONDecodeError:
        print("No JSON data in response.")
    return None

def get_stations(parameter_key):
    url = f"https://opendata-download-ocobs.smhi.se/api/version/latest/parameter/{parameter_key}.json"
    data = get_response(url)

    if data:
        stations = data['station']
        for station in stations:
            print(f"Station ID: {station['key']}, Name: {station['name']}")

