import requests
import matplotlib.pyplot as plt
import matplotlib.dates as mdates
from datetime import datetime

def get_data(api_url):
    response = requests.get(api_url)
    if response.status_code == 200:
        return response.json()
    else:
        print(f"Error fetching data: HTTP {response.status_code}")
        return None

def create_time_series_chart(values):
    dates = [datetime.fromtimestamp(value['date']/1000) for value in values]
    temperatures = [value['value'] for value in values]

    plt.figure(figsize=(10, 6))
    plt.plot(dates, temperatures, marker='o')
    plt.gca().xaxis.set_major_formatter(mdates.DateFormatter('%Y-%m-%d'))
    plt.gca().xaxis.set_major_locator(mdates.DayLocator())
    plt.xlabel('Datum')
    plt.ylabel('Temperatur (°C)')
    plt.title('Havstemperaturer över Tid')
    plt.grid(True)
    plt.show()

if __name__ == "__main__":
    # Exempel-URL för att hämta havstemperaturdata
    api_url = 'https://opendata-download-ocobs.smhi.se/api/version/latest/parameter/5/station/S010/period/latest-months/data.json'
    data = get_data(api_url)

    if data and 'value' in data:
        create_time_series_chart(data['value'])

