# Importera efter eventuell installation
import geopandas as gpd
import rasterio
import matplotlib.pyplot as plt
import numpy as np
import rasterio
from matplotlib.colors import ListedColormap, BoundaryNorm
from urllib.parse import quote

# Define the file path for the air quality GeoTIFF data
file_path = 'https://github.com/soleildeminuit/AI-Samhallsplanering-Course/raw/main/data/raw/Stockholm-NO2-Årsmedelvärde.tiff'

# Open the GeoTIFF file
with rasterio.open(file_path) as src:
    # Read the first band of the raster
    data = src.read(1)
    # Mask the data to handle NoData values appropriately
    masked_data = np.ma.masked_where(data == src.nodatavals[0], data)
    # Store the raster bounds for later use
    raster_bounds = src.bounds

# Definiera en uppdaterad färglegend med fler färger
color_legend = [
    ("#F0F0F0", "< 2.5"),
    ("#CCFF66", "2.5 - 5"),
    ("#FFFF00", "5 - 7.5"),
    ("#FFCC00", "7.5 - 10"),
    ("#FF9900", "10 - 15"),
    ("#FF6600", "15 - 20"),
    ("#FF3300", "20 - 26"),
    ("#FF0000", "26 - 32"),
    ("#CC0000", "32 - 40"),
    ("#990033", "40 - 50"),
    ("#660033", "> 50")
]

# Skapa en färgkarta och normalisering från den uppdaterade legenden
cmap = ListedColormap([color[0] for color in color_legend])
norm = BoundaryNorm([0, 2.5, 5, 7.5, 10, 15, 20, 26, 32, 40, 50, 60], len(color_legend))

preschools_path = 'https://github.com/soleildeminuit/AI-Samhallsplanering-Course/raw/main/data/raw/förskolor_Stockholm_sweref99tm_antalbarn.gpkg'
safe_preschools_path = quote(preschools_path, safe=':/')
preschools_gdf = gpd.read_file(safe_preschools_path)

# Load the preschools data from a GeoPackage
#preschools_path = 'https://github.com/soleildeminuit/AI-Samhallsplanering-Course/raw/main/data/raw/förskolor_Stockholm_sweref99tm_antalbarn.gpkg'
#preschools_gdf = gpd.read_file(preschools_path)

# Adjust the size of the markers for the number of children
sizes = preschools_gdf['numberOfChildren'].fillna(0) * 0.5

# Plot the air quality map
fig, ax = plt.subplots(figsize=(10, 10), facecolor='white')
# Display the masked data with the custom colormap
img = ax.imshow(masked_data, cmap=cmap, norm=norm, extent=[raster_bounds.left, raster_bounds.right, raster_bounds.bottom, raster_bounds.top], origin='upper')

# Create a color bar for the NO2 values with custom labels from the legend
colorbar = fig.colorbar(img, ax=ax, fraction=0.03, pad=0.04)
colorbar.set_ticks([1.25, 3.75, 6.25, 8.75, 12.5, 17.5, 23, 29, 36, 45, 55])
colorbar.set_ticklabels([label[1] for label in color_legend])

# Plot the preschools on the map
preschools_gdf.plot(ax=ax, color='blue', markersize=sizes, alpha=0.6)

# Set the title and remove axes for a clean look
plt.axis('off')
plt.title('NO2 Levels in Stockholm Municipality with Preschool Locations', color='black')

# Save the figure with the NO2 values legend
fig_path = 'NO2_Levels_Stockholm_with_Preschools_Legend.png'
fig.savefig(fig_path, bbox_inches='tight', facecolor='white')

# Display the plot
plt.show()

