"""
Analysera luftkvalitet i specifika områden, med geoata

Detta skript utför följande steg för att analysera luftkvaliteten i specifika områden:
1. Kontrollerar och installerar nödvändiga bibliotek (geopandas, rasterio, requests, matplotlib).
2. Laddar ner geospatial vektordata (GeoPackage) och rasterdata (GeoTIFF) för luftkvalitet (NO2-nivåer).
3. Filtrerar ut specifikt område baserat på geografiskt namn.
4. Beskär rasterdata till det valda området.
5. Sparar det beskurna området som en ny GeoTIFF-fil.
6. Visualiserar det beskurna rasterområdet för att visa NO2-nivåerna.

Datakällor:
- GeoPackage med regionala statistikområden (RegSO).
- GeoTIFF med NO2-årsmedelvärden i Stockholm.
"""

import subprocess
import sys

# Function to install packages
def install(package):
    subprocess.check_call([sys.executable, "-m", "pip", "install", package])

# Check and install 'geopandas'
try:
    import geopandas as gpd
except ImportError:
    install("geopandas")
    import geopandas as gpd

# Check and install 'rasterio'
try:
    import rasterio
    from rasterio.mask import mask
except ImportError:
    install("rasterio")
    import rasterio
    from rasterio.mask import mask

# Check and install 'requests'
try:
    import requests
except ImportError:
    install("requests")
    import requests

from io import BytesIO

# URLs for the data files
gpkg_url = 'https://github.com/soleildeminuit/AI-Samhallsplanering-Course/raw/main/data/raw/RegSO_2018_v2.gpkg'
tiff_url = 'https://github.com/soleildeminuit/AI-Samhallsplanering-Course/raw/main/data/raw/Stockholm-NO2-Årsmedelvärde.tiff'

# Function to download a file from a URL
def download_file(url):
    r = requests.get(url)
    if r.status_code == 200:
        return BytesIO(r.content)
    else:
        raise Exception(f"Failed to download file from {url}")

# Download and read the vector data (GeoPackage)
gpkg_file = download_file(gpkg_url)
gdf = gpd.read_file(gpkg_file, layer='RegSO_2018_v2')

# Filter for 'Engelbrekts kyrka'
engelbrekts_kyrka = gdf[gdf['regso'] == 'Engelbrekts kyrka']

# Ensure there's exactly one match
if len(engelbrekts_kyrka) == 1:
    geometry = engelbrekts_kyrka.geometry.values[0].__geo_interface__
else:
    raise ValueError("Area not found or multiple areas with the same name.")

# Download the raster data (GeoTIFF)
tiff_file = download_file(tiff_url)

# Open and crop the raster data
with rasterio.open(tiff_file) as src:
    out_image, out_transform = mask(src, [geometry], crop=True)
    out_meta = src.meta.copy()

    out_meta.update({"driver": "GTiff",
                     "height": out_image.shape[1],
                     "width": out_image.shape[2],
                     "transform": out_transform})

# Path where the cropped raster will be saved (update this path as needed)
cropped_raster_path = 'Engelbrekts_kyrka_NO2.tiff'

# Save the cropped area as a new GeoTIFF file
with rasterio.open(cropped_raster_path, "w", **out_meta) as dest:
    dest.write(out_image)

print(f"Successfully saved cropped area to {cropped_raster_path}")

# Check and install 'matplotlib'
try:
    import matplotlib.pyplot as plt
except ImportError:
    install("matplotlib")
    import matplotlib.pyplot as plt

# After saving the cropped raster file

# Function to visualize a raster file
def visualize_raster(path):
    with rasterio.open(path) as src:
        # Read the raster data
        image = src.read(1)  # Read the first band

        # Plot the raster data
        plt.figure(figsize=(10, 6))
        plt.imshow(image, cmap='viridis')
        plt.colorbar(label='NO2 levels')
        plt.title('Cropped Raster Visualization')
        plt.xlabel('Column #')
        plt.ylabel('Row #')
        plt.show()

# Visualize the cropped raster file
visualize_raster(cropped_raster_path)

