# Senaste uppdatering om afrikansk svinpest i Fagersta (2 november 2023):
# - Totalt 53 bekräftade fall av afrikansk svinpest i Fagersta.
# - Fyra nya fall upptäcktes i kärnområdet, norr om Skeppmora utanför Fagersta.
# - Åtgärder inkluderar uppsättning av stängsel och fällor för att fånga och avliva vildsvin.
