# Kontrollera det nuvarande koordinatsystemet för shapefilen
current_crs = fence_data.crs

# Om koordinatsystemet inte är WGS 84 (EPSG:4326), transformera det
target_crs = 'EPSG:4326'
if current_crs and current_crs.to_epsg() != 4326:
    transformed_fence_data = fence_data.to_crs(target_crs)
else:
    transformed_fence_data = fence_data

# Skapa en ny bas karta med den transformerade datan
