"""
Detta Python-skript visualiserar geografisk info relaterad till Afrikansk
svinpest (eng. African swine fever virus), genom att visa data för stängsel
och restriktionsområden. Skriptet genomför följande steg:
1. Import av bibliotek: Använder geopandas för geografisk datahantering och
   folium för interaktiva kartor.
2. Laddning av geodata: Laddar data för stängslet och restriktionsområdet
   från specificerade GeoPackage-filer.
3. Kontrollera och transformera koordinatsystemet: Om inte WGS 84
   (EPSG:4326), transformeras datan.
4. Skapa en bas karta: Ny bas karta skapas med transformerad data.
5. Lägga till stängslet på kartan: Visualiserar stängseldatan med röda linjer.
6. Lägga till restriktionsområdet: Visualiserar området med blå färg.
7. Spara den uppdaterade kartan: Sparar kartan till en HTML-fil.
Detta skript är användbart för att visualisera och analysera åtgärder mot
African swine fever virus."
"""
import geopandas as gpd
import folium

# Ladda geodata för stängslet och restriktionsområdet
fence_shapefile_path = '/content/sample_data/Ny_stängseldragning_bes.gpkg'  # Ursprunglig sökväg för stängslet
restriction_shapefile_path = '/content/sample_data/restriktionsomrade.gpkg'  # Ursprunglig sökväg för restriktionsområdet

fence_data = gpd.read_file(fence_shapefile_path)
restriction_area_data = gpd.read_file(restriction_shapefile_path)

# Kontrollera och transformera koordinatsystemet till WGS 84 (EPSG:4326) om det behövs
target_crs = 'EPSG:4326'
transformed_fence_data = fence_data.to_crs(target_crs) if fence_data.crs.to_epsg() != 4326 else fence_data
transformed_restriction_data = restriction_area_data.to_crs(target_crs) if restriction_area_data.crs.to_epsg() != 4326 else restriction_area_data

# Skapa en ny bas karta med den transformerade datan
map_center_transformed = transformed_fence_data.geometry.centroid.iloc[0]
base_map_transformed = folium.Map(location=[map_center_transformed.y, map_center_transformed.x], zoom_start=12)

# Lägg till det transformerade stängslet på kartan
for _, row in transformed_fence_data.iterrows():
    if row['geometry'] is not None:
        sim_geo = gpd.GeoSeries(row['geometry'])
        geo_j = sim_geo.to_json()
        geo_j = folium.GeoJson(data=geo_j, style_function=lambda x: {'color': 'red', 'weight': 5})
        geo_j.add_to(base_map_transformed)

# Lägg till restriktionsområdet på kartan
for _, row in transformed_restriction_data.iterrows():
    if row['geometry'] is not None:
        sim_geo = gpd.GeoSeries(row['geometry'])
        geo_j = sim_geo.to_json()
        geo_j = folium.GeoJson(data=geo_j, style_function=lambda x: {'color': 'blue', 'weight': 3, 'fillColor': 'blue', 'fillOpacity': 0.5})
        geo_j.add_to(base_map_transformed)

# Spara den uppdaterade kartan till en HTML-fil
transformed_map_file_path = 'transformed_interactive_map_fagersta_norberg.html'
base_map_transformed.save(transformed_map_file_path)

base_map_transformed  # Denna rad visar kartan direkt i Colab-konsolfönstret

"""
Detta Python-skript hämtar byggnader från Open Street Map inom ett specifikt
begränsningsområde. Det är användbart för Afrikansk svinpest och dess
påverkan på infrastruktur. Processen innefattar:
1. Importera bibliotek: geopandas, requests, shapely, folium.
2. Definiera funktion för Overpass API: get_overpass_data gör API-förfrågningar.
3. Läs in geodata från GeoPackage-fil: Inläsning från specificerad filväg.
4. Kontrollera och omvandla projektion: Till WGS84 (EPSG:4326) vid behov.
5. Beräkna bounding box för området: Skapar bounding box för området.
6. Skapa Overpass-fråga med bounding box: För att hämta byggnader inom boxen.
7. Hämta och bearbeta data från Overpass API: Separerar noder och vägar.
8. Skapa geometrier för vägarna: Polygoner baserade på vägarnas noder.
9. Skapa en GeoDataFrame: Polygonerna omvandlas till en GeoDataFrame.
10. Skapa och konfigurera interaktiv karta med Folium: Visualiserar byggnader.

Optimerat för detaljerad info om infrastruktur, viktigt för forskning och
övervakning av Afrikansk svinpest (African swine fever virus).
"""
import geopandas as gpd
import requests
from shapely.geometry import Point, Polygon
import folium

# Funktion för att hämta data från Overpass API
def get_overpass_data(query):
    overpass_url = "https://overpass-api.de/api/interpreter"
    response = requests.post(overpass_url, data={'data': query})
    response.raise_for_status()
    return response.json()

# Läs in geodata från GeoPackage-filen
restriction_shapefile_path = '/content/sample_data/restriktionsomrade.gpkg'  # Ursprunglig sökväg för restriktionsområdet
restriktionsomrade = gpd.read_file(restriction_shapefile_path)

# Kontrollera och omvandla projektionen till WGS84 (EPSG:4326) om nödvändigt
if restriktionsomrade.crs.to_epsg() != 4326:
    restriktionsomrade = restriktionsomrade.to_crs(epsg=4326)

# Beräkna bounding box för området
bbox = restriktionsomrade.total_bounds
west, south, east, north = bbox  # Rätt ordning för bbox är [west, south, east, north]

# Overpass-query med bounding box från geodata
overpass_query = f"""
[out:json][timeout:60];
(
  way[building]({south},{west},{north},{east});
  >;
);
out qt;
"""

# Hämta data från Overpass API
data = get_overpass_data(overpass_query)

# Separera noder och vägar
nodes = {}
ways = []

for element in data['elements']:
    if element['type'] == 'node':
        nodes[element['id']] = (element['lon'], element['lat'])
    elif element['type'] == 'way':
        ways.append(element)

# Skapa geometrier för vägarna
features = []
for way in ways:
    way_nodes = way['nodes']
    points = [Point(nodes[node_id]) for node_id in way_nodes if node_id in nodes]
    if len(points) > 2 and points[0] == points[-1]:
        polygon = Polygon([[p.x, p.y] for p in points])
        features.append({'geometry': polygon, 'id': way['id']})

# Skapa en GeoDataFrame
gdf = gpd.GeoDataFrame(features, crs="EPSG:4326")

# Skapa en interaktiv karta
# m = folium.Map(location=[59.8595061, 15.6957547], zoom_start=13)
# Skapa en interaktiv karta centrerad på de angivna koordinaterna
m = folium.Map(location=[59.97985799640618, 15.811641283675348], zoom_start=15)

# Lägg till de första 100 byggnaderna på kartan
for _, row in gdf.iloc[:1000].iterrows():
    sim_geo = folium.GeoJson(row['geometry'], style_function=lambda x: {'fillColor': 'blue', 'color': 'blue'})
    sim_geo.add_to(m)
m

