"""
Detta skript hämtar data från Kolada API. Funktionerna är:

1. hämta_nyckeltal: Hämtar nyckeltal från KKiK.
2. hämta_helsingborg_id: Hämtar ID för Helsingborg kommun.
3. hämta_data: Hämtar data för givna nyckeltal och kommun för 2013.

Resultatet skrivs ut i slutet av skriptet.
"""

import requests

def hämta_nyckeltal():
    url = "http://api.kolada.se/v2/kpi_groups?title=kkik"
    response = requests.get(url)
    nyckeltal = [member['member_id'] for member in response.json()['values'][0]['members']]
    return nyckeltal

def hämta_helsingborg_id():
    url = "http://api.kolada.se/v2/municipality?title=helsingborg"
    response = requests.get(url)
    helsingborg_id = response.json()['values'][0]['id']
    return helsingborg_id

def hämta_data(nyckeltal, helsingborg_id, år="2013"):
    nyckeltal_str = ','.join(nyckeltal)
    url = f"http://api.kolada.se/v2/data/kpi/{nyckeltal_str}/municipality/{helsingborg_id}/year/{år}"
    response = requests.get(url)
    return response.json()

# Använd funktionerna
nyckeltal = hämta_nyckeltal()
helsingborg_id = hämta_helsingborg_id()
data = hämta_data(nyckeltal, helsingborg_id)

# Skriv ut data
print(data)

