"""
Detta Python-skript skapar en koropletkarta (tematisk karta) som visualiserar ett
robusthetsindex för svenska kommuner, liknande det föregående skriptet. Skillnaden
här är att detta skript använder jämna intervall för att klassificera robusthetsindexet
och anpassar legenden för att visa dessa intervall. Processen innefattar:

1. Importera bibliotek: geopandas för geografisk datahantering, pandas för datahantering
   och matplotlib för visualisering.
2. Läs in datafilen med robusthetsindex för kommunerna.
3. Läs in shapefilen med geografisk data för svenska kommuner.
4. Korrigera namnmatchningsfel i datafilen (till exempel 'Malung-Sälen' till 'Malung').
5. Sammanfoga data- och geodatafilerna.
6. Använda jämna intervall för att klassificera kommunernas robusthetsindex.
7. Beräkna intervall för varje klass och justera legenden för att visa dessa.
8. Skapa och anpassa en koropletkarta som visar robusthetsindexklasser per kommun.
9. Spara kartan som en bildfil.

I jämförelse med det föregående skriptet, ger detta skript en mer detaljerad
visuell representation av hur kommunerna grupperas i olika klasser baserat på
deras robusthetsindex. Detta är användbart för att få en djupare förståelse av
robusthetsfördelningen över landet."
"""
import geopandas as gpd
import pandas as pd
import matplotlib.pyplot as plt

# Läs in datan
data_file_path = 'https://github.com/soleildeminuit/AI-Samhallsplanering-Course/raw/main/data/raw/kommunkampen.txt'
data_df = pd.read_csv(data_file_path, encoding='utf-8')

# Läs in shapefilen för geografiska data
shapefile_path = '/content/sample_data/geodata/Kommun_Sweref99TM_region.shp'
geo_df = gpd.read_file(shapefile_path)

# Korrigera felmatchade kommunnamn i datan
data_df_corrected = data_df.replace({'Kommun_namn': {'Malung-Sälen': 'Malung'}})

# Sammanfoga datan med de geografiska uppgifterna
merged_df = geo_df.merge(data_df_corrected, left_on='KnNamn', right_on='Kommun_namn')

# Använda jämna intervall för klassindelning av choropletkarta
num_classes = 5
merged_df['class'] = pd.cut(merged_df['Summa_robusthetsanalys'], bins=num_classes, labels=False)

# Beräkna intervall för varje klass
class_intervals = pd.cut(merged_df['Summa_robusthetsanalys'], bins=num_classes)
interval_labels = class_intervals.cat.categories

# Skapa choropletkarta med heltalsintervaller i legenden
fig, ax = plt.subplots(1, 1, figsize=(15, 10))
merged_df.plot(column='class', cmap='viridis', linewidth=0.1, ax=ax,
               edgecolor='black', legend=True,
               legend_kwds={'label': "Robusthetsindex Klasser",
                            'orientation': "vertical",
                            'shrink': 0.3,
                            'ticks': range(num_classes),
                            'format': lambda x, _: str(interval_labels[x].left.astype(int)) + ' - ' + str(interval_labels[x].right.astype(int))})

# Ange titlar och etiketter
ax.set_title('Tematisk Koropletkarta med Jämna Intervaller - Robusthetsindex för Svenska Kommuner', fontsize=15)
ax.set_axis_off()

