"""
Detta Python-skript hämtar och visualiserar befolkningsstatistik för de tio mest
befolkade regionerna ('regso') i Sverige, uppdelat efter kön. Det hämtar data
från Statistiska centralbyråns (SCB) API, omvandlar data till ett användbart
format och skapar ett stapeldiagram för att illustrera fördelningen.
Processen innefattar:

1. Importera bibliotek: requests för att göra HTTP-anrop, pandas för datahantering och
   matplotlib för visualisering.
2. Definiera en funktion 'fetch_and_plot_data' för att hämta och visualisera data.
3. Hämta data från SCB:s API med en GET-förfrågan.
4. Omvandla teckenkodningen och skapa en DataFrame från API-svaret.
5. Översätta kodade könsvärden till läsbara etiketter ('Kvinnor', 'Män').
6. Filtrera bort rader med totala könsvärden.
7. Beräkna och välj ut de tio mest befolkade regionerna.
8. Skapa en pivot-tabell för att gruppera data efter kön och region.
9. Sortera data baserat på den totala befolkningen.
10. Skapa och visa ett grupperat stapeldiagram som visar befolkningsfördelning.

Denna visualisering ger insikt i befolkningsfördelningen mellan könen i Sveriges mest
befolkade regioner, vilket är användbart för samhällsplanering och demografiska studier."
"""
import requests
import pandas as pd
import matplotlib.pyplot as plt

# https://www.statistikdatabasen.scb.se/pxweb/sv/ssd/START__BE__BE0101__BE0101Y/FolkmDesoAldKonN/table/tableViewLayout1/

def fetch_and_plot_data(url):
    response = requests.get(url)
    data = response.json()
    column_info = data['columns']
