drug_scenes_gdf = gpd.read_file("/path/to/oppna_drogscener_2017-2023.geojson")
stockholm_preschools_gdf = gpd.read_file("/path/to/Stockholm_Forskolor.gpkg")

# Ändra CRS för drogscenerna till EPSG:3006 för att matcha förskolornas data
if drug_scenes_gdf.crs.to_string() != 'epsg:3006':
    drug_scenes_gdf = drug_scenes_gdf.to_crs(epsg=3006)

# Filtrera drogscenerna för att endast behålla de inom Stockholms kommun
stockholm_polygon = stockholm_preschools_gdf.unary_union
stockholm_drug_scenes = drug_scenes_gdf[drug_scenes_gdf.geometry.within(stockholm_polygon)]

# Räkna antalet förskolor nära varje drogscen och sortera
stockholm_drug_scenes['preschool_count'] = stockholm_drug_scenes.geometry.apply(
    lambda x: sum(x.intersects(y) for y in stockholm_preschools_gdf.geometry.buffer(250))
)
sorted_drug_scenes = stockholm_drug_scenes.sort_values(by='preschool_count', ascending=False)

# Extrahera de tre öppna drogscenerna med flest förskolor i närheten
top_3_drug_scenes = sorted_drug_scenes.head(3)

# Skapa en plot för att visualisera data
