preschools_near_drug_scenes = stockholm_preschools_gdf[stockholm_preschools_gdf.isin(top_3_drug_scenes.geometry.buffer(250).apply(lambda x: any(x.intersects(y) for y in stockholm_drug_scenes.geometry)))]

preschools_not_near_drug_scenes.plot(ax=ax, color="blue", markersize=5, label='Förskolor (ej nära drogscener)')
preschools_near_drug_scenes.plot(ax=ax, color="red", markersize=5, label='Förskolor (nära drogscener)')
