# 1. Importerar nödvändiga bibliotek.
# 2. Laddar in geospatial data för förskolor, Stockholm stadens gränser, öppna drogscener och utsatta områden.
# 3. Konverterar alla dataset till samma koordinatsystem (EPSG:3006).
# 4. Filtrerar förskolor, drogscener och utsatta områden inom Stockholm stadens gränser.
# 5. Beräknar avståndet från varje förskola till den närmaste drogscenen.
# 6. Skapar ytor för drogscenerna och utsatta områden för visualisering.
# 7. Färglägger förskolor baserat på avstånd till närmaste drogscen med en tröskel på 100 meter.
# 8. Anpassar förskolornas och utsatta områdenas punkter för att vara halvtransparenta.
# 9. Skapar och sparar kartan med en titel.

import geopandas as gpd
import matplotlib.pyplot as plt
from shapely.ops import unary_union

preschools = gpd.read_file('https://github.com/soleildeminuit/AI-Samhallsplanering-Course/raw/main/data/raw/Forskolor_ht23_sweref.gpkg')
stockholm_boundary = gpd.read_file('https://github.com/soleildeminuit/AI-Samhallsplanering-Course/raw/main/data/raw/Stockholm_Kommun.gpkg')
drug_scenes = gpd.read_file('https://github.com/soleildeminuit/AI-Samhallsplanering-Course/raw/main/data/raw/oppna_drogscener_2017-2023.geojson')
vulnerable_areas = gpd.read_file('https://github.com/soleildeminuit/AI-Samhallsplanering-Course/raw/main/data/raw/uso_2023.json')

preschools = preschools.to_crs(epsg=3006)
stockholm_boundary = stockholm_boundary.to_crs(epsg=3006)
drug_scenes = drug_scenes.to_crs(epsg=3006)
vulnerable_areas = vulnerable_areas.to_crs(epsg=3006)

preschools_within_stockholm = preschools[preschools.geometry.apply(lambda x: stockholm_boundary.unary_union.contains(x))]
drug_scenes_within_stockholm = drug_scenes[drug_scenes.geometry.apply(lambda x: stockholm_boundary.unary_union.contains(x))]
vulnerable_areas_within_stockholm = vulnerable_areas[vulnerable_areas.geometry.apply(lambda x: stockholm_boundary.unary_union.contains(x))]

preschools_within_stockholm['distance_to_nearest_drug_scene'] = preschools_within_stockholm.geometry.apply(
    lambda x: drug_scenes_within_stockholm.geometry.distance(x).min())

buffer_radius = 50  # meters
drug_scenes_areas = drug_scenes_within_stockholm.buffer(buffer_radius)

preschools_within_stockholm['color'] = preschools_within_stockholm['distance_to_nearest_drug_scene'].apply(
    lambda x: 'red' if x <= 100 else 'blue')

fig, ax = plt.subplots(figsize=(15, 15))
stockholm_boundary.plot(ax=ax, color='white', edgecolor='black')
drug_scenes_areas.plot(ax=ax, color='lightgrey', edgecolor='black', linewidth=0.5)
vulnerable_areas_within_stockholm.plot(ax=ax, color='purple', edgecolor='black', alpha=0.25)
preschools_within_stockholm.plot(ax=ax, color=preschools_within_stockholm['color'], markersize=50, alpha=0.5)
plt.title('Stockholms förskolor, öppna drogscener och utsatta områden')
ax.set_axis_off()
fig.savefig('stockholm_preschools_drug_scenes_vulnerable_areas_map.png', bbox_inches='tight')

