livskvalitetsbrott_gdf = read_geojson(livskvalitetsbrott_url)
befolkning_basomraden_gdf = read_geojson(befolkning_basomraden_url)

# Converting the 'KOMKOD' columns to string and prepending '01' for Stockholm county
livskvalitetsbrott_gdf['KOMKOD'] = '01' + livskvalitetsbrott_gdf['KOMKOD'].astype(str).str.zfill(2)
befolkning_basomraden_gdf['KOMKOD'] = '01' + befolkning_basomraden_gdf['KOMKOD'].astype(str).str.zfill(2)

