# Skapa en anpassad färgskala
colorscale = linear.YlOrRd_06.scale(1, 6)
gdf['color'] = gdf['Områdestyp_index'].apply(lambda x: colorscale(x))

# Översätt områdesindex till beskrivande text
def index_description(index):
    return {
        1: 'Mycket sårbart',
        2: 'Ganska sårbart',
        3: 'Medium sårbarhet',
        4: 'Medium goda livsvillkor',
        5: 'Ganska goda livsvillkor',
        6: 'Mycket goda livsvillkor'
    }.get(index, 'Okänd')

# Skapa en ny kolumn för beskrivningstext
gdf['description'] = gdf['Områdestyp_index'].apply(index_description)

# Skapa kartan
m = folium.Map(location=[59.3293, 18.0686], zoom_start=10)

# Funktion för att styla GeoJSON-lagret baserat på 'Områdestyp_index'
def style_function(feature):
    return {
        'fillColor': colorscale(feature['properties']['Områdestyp_index']),
        'color': 'black',
        'weight': 1,
        'fillOpacity': 0.7
    }

# Lägg till GeoJSON-lager till kartan med popup-rutor och färgsättning
folium.GeoJson(
    gdf,
    style_function=style_function,
    tooltip=folium.GeoJsonTooltip(fields=['DeSO', 'Områdestyp_index'],
                                  aliases=['DeSO-kod:', 'Områdestyp Index:']),
    popup=folium.GeoJsonPopup(fields=['description'],
                              aliases=['Beskrivning:'],
                              labels=True,
                              localize=True)
).add_to(m)

# Lägg till färglegend
colorscale.caption = 'Områdestyp Index'
colorscale.add_to(m)

# Visa kartan
m.save('omradesindex_karta.html')

m

