"""
Python-skript för att omvandla tidsstämplade frekvensdata från en textfil till 'tidy data'-format,
och för att skapa ett tidsseriediagram.

Steg-för-steg beskrivning:
1. Läs innehållet i en uppladdad textfil som innehåller tidsstämplade frekvensdata.
2. Skapa en Pandas DataFrame från textfilens innehåll, som är tabbavgränsad.
3. Omvandla DataFrame till ett "tidy data"-format genom att använda Pandas melt-funktion.
4. Rengör data genom att ta bort textprefix ('Sekund ') och suffix (' Hz'), och konvertera komma till punkt i decimaltal.
5. Skapa en ny 'Timestamp'-kolumn för varje sekund baserad på 'Minut'- och 'Sekund'-kolumnerna.
6. Behåll endast nödvändiga kolumner ('Timestamp' och 'Frekvens') i DataFrame.
7. Spara den omformade datan som en CSV-fil.
8. Filtrera DataFrame för att visa data över dygnsgränsen, från 23:24 den 23 december 2023 till 00:24 den 24 december 2023.
9. Konvertera 'Timestamp'-kolumnen till ett format som kan användas av Matplotlib.
10. Skapa ett tidsseriediagram som visualiserar frekvensen över tiden med lämplig formatering och axelbeteckningar.
"""

import pandas as pd
import matplotlib.pyplot as plt
import matplotlib.dates as mdates
import requests
import io  # Lägg till denna rad

# Läs innehållet i den uppladdade textfilen
url = 'https://raw.githubusercontent.com/soleildeminuit/AI-Samhallsplanering-Course/main/data/raw/svk_kontrollrummet_frekvens.txt'
response = requests.get(url)
file_content = response.text.splitlines()

# Skriv ut de första raderna av filinnehållet
# for line in file_content[:5]:
#    print(line)

# Anta att det finns en header. Om det inte finns någon, ange header=None
df = pd.read_csv(io.StringIO('\n'.join(file_content)), delimiter='\t', header=0)

# Skriv ut de första raderna i DataFrame för att kontrollera
#print(df.head())

# Omvandla DataFrame till ett "tidy data"-format
# Melting förvandlar data till ett långt format med en rad för varje sekund
tidy_df = df.melt(id_vars=["Minut"], var_name="Sekund", value_name="Frekvens")

# Rengör data genom att ta bort textprefix och suffix, och konvertera decimaltecken
tidy_df['Sekund'] = tidy_df['Sekund'].str.replace('Sekund ', '').astype(int)
tidy_df['Frekvens'] = tidy_df['Frekvens'].str.replace(' Hz', '').str.replace(',', '.').astype(float)

# Skapa en timestamp-kolumn för varje sekund
tidy_df['Timestamp'] = pd.to_datetime('2023-12-24 ' + tidy_df['Minut']) + pd.to_timedelta(tidy_df['Sekund'], unit='s')

# Förfina DataFrame till att endast inkludera nödvändiga kolumner
tidy_df = tidy_df[['Timestamp', 'Frekvens']]

# Spara DataFrame som CSV-fil
output_file_path = 'tidy_data.csv'
tidy_df.to_csv(output_file_path, index=False)

# Filtrera DataFrame för att visa data över dygnsgränsen
start_time = pd.Timestamp('2023-12-23 23:24')
end_time = pd.Timestamp('2023-12-24 00:24')
filtered_df = tidy_df[(tidy_df['Timestamp'] >= start_time) & (tidy_df['Timestamp'] <= end_time)]

# print(filtered_df.head())

# Sortera data efter 'Timestamp'
filtered_df = filtered_df.sort_values('Timestamp')

# Sedan plotta som tidigare
plt.figure(figsize=(15, 6))
plt.plot_date(filtered_df['Timestamp'], filtered_df['Frekvens'], linestyle='solid', marker=None)

# Ange titel och axellabels för diagrammet
plt.title('Frekvens över Tid (23:24 2023-12-23 till 00:24 2023-12-24)')
plt.xlabel('Tid (HH:MM:SS)')
plt.ylabel('Frekvens (Hz)')

