def get_school_unit_details(school_unit_code):
    detail_endpoint = f"https://api.skolverket.se/skolenhetsregistret/v1/skolenhet/{school_unit_code}"
    try:
        response = requests.get(detail_endpoint, timeout=10)
        if response.status_code == 200:
            return response.json()
        else:
            return f"Failed to retrieve details for school unit code {school_unit_code}. Status code: {response.status_code}"
    except Exception as e:
        return f"An error occurred: {e}"

