import pandas as pd
import re

# Ostrukturerad data
data = [
    "Blekinge: 246 000 i uppräkning och en särskild förstärkning på 700 000. Totalt 28,2 miljoner.",
    "Dalarna: 391 000 i uppräkning och en särskild förstärkning på 400 000. Totalt 44,1 miljoner.",
    # ... (inkludera resten av dina datarader här) ...
    "Östergötland: 778 000 i uppräkning. Totalt 87,2 miljoner.",
    "Verksamheter i Region Stockholm: 942 000 i uppräkning. Totalt 107,5 miljoner."
]

def extract_data_correct(line):
    # Extraherar län
    county = re.search(r"^[A-Za-zåäöÅÄÖ ]+(?= län|:)", line).group()
    county = re.sub(r" län|Region |Verksamheter i ", "", county)

    # Extraherar belopp
    uppraknat = re.search(r"(\d[\d\s,]*) i uppräkning", line)
    forstarkning = re.search(r"en särskild förstärkning på (\d[\d\s,]*)", line)
    totalt = re.search(r"Totalt (\d+[\s,]*\d*) miljoner", line)

    uppraknat = re.sub(r"\s|,", "", uppraknat.group(1)) if uppraknat else ""
    forstarkning = re.sub(r"\s|,", "", forstarkning.group(1)) if forstarkning else ""
    totalt = int(float(re.sub(r"\s|,", ".", totalt.group(1))) * 1000000) if totalt else ""

    return [county, uppraknat, forstarkning, totalt]

# Bearbeta datat
processed_data = [extract_data_correct(line) for line in data]

# Skapa DataFrame
df = pd.DataFrame(processed_data, columns=["län", "uppräknat_belopp", "förstärkning_belopp", "totalt"])

# Skapa CSV-fil
csv_file = "/content/sample_data/kulturanalys_data.csv"
df.to_csv(csv_file, sep=";", index=False)

