import matplotlib.pyplot as plt
from fuzzywuzzy import process

# Läs in shapefilen för Sveriges län
lan_shapefile_path = "https://raw.githubusercontent.com/soleildeminuit/AI-Samhallsplanering-Course/main/data/raw/Lan_Sweref99TM_region.shp"
