# Skapa en lista av unika länsnamn från CSV-filen
unique_csv_lan = df_csv['län'].unique().tolist()

# Funktion för att hitta den bästa fuzzy matchningen för länsnamn
def find_best_match(name, choices):
    best_match = process.extractOne(name, choices)
    return best_match[0] if best_match else name

# Applicera fuzzy matchning för att hitta motsvarande länsnamn i CSV-filen
lan_gdf['LnNamn_best_match'] = lan_gdf['LnNamn'].apply(lambda x: find_best_match(x, unique_csv_lan))

# Sammanslagning av GeoDataFrame med CSV-filen baserat på bästa matchningarna
merged_gdf_fuzzy = lan_gdf.merge(df_csv, left_on='LnNamn_best_match', right_on='län', how='left')

# Konvertera 'totalt' belopp till formatet 'miljoner'
def convert_to_millions(value):
    return f"{value / 1e6:.1f} miljoner"

