"""
Skript för att hämta ett OAuth access_token från en API-tjänst.
Detta skript är en översättning från ett motsvarande R-skript och använder
Python-paketet 'requests' för att utföra HTTP-anrop.

Funktionen fetch_oauth_token gör ett POST-anrop till en angiven URL för att
hämta ett access_token som används för autentisering mot API-tjänster.
Skriptet innehåller även kontroller för att hantera fel vid API-anrop.

Observera: SSL-certifikatkontrollen är avaktiverad i detta skript (verify=False i
requests.post-anropet). Detta bör endast användas i en testmiljö och inte i
produktionsmiljöer på grund av säkerhetsrisker.
"""

import requests

def fetch_oauth_token():
    """
    Funktion för att hämta OAuth access_token från en API-tjänst.
    Gör ett POST-anrop till en fördefinierad URL med nödvändiga headers och
    payload för att autentisera och erhålla token.
    """
    # URL till OAuth-tjänsten
    url = "https://apimanager.lantmateriet.se/oauth2/token"

    # POST-data
    payload = {
        'grant_type': 'client_credentials'
    }

    # Definiera headers
    headers = {
        'Authorization': 'Basic [DIN Basic BASE64(CONSUMER-KEY:CONSUMER-SECRET)]',
        'Content-Type': 'application/x-www-form-urlencoded'
    }

    # Göra POST-anropet
    response = requests.post(url, data=payload, headers=headers, verify=False)

    # Kontrollera statuskod
    if response.status_code != 200:
        print("Error calling API:", response.reason)
