"""
Skript för att hämta detaljplaner från Nationella Geodataplattformen (Lantmäteriet)
och skapa en interaktiv HTML-/JavaScript-karta.

Förutsättningar:
- Ett giltigt access_token erhållet från Lantmäteriets API.

Detta skript utför följande steg:
1. Kontrollerar och installerar nödvändiga bibliotek (requests, pandas, geopandas, folium).
2. Frågar användaren efter access_token.
3. Skickar en GET-förfrågan till Lantmäteriets API för att hämta detaljplaner.
4. Parsar svaret och omvandlar det till en GeoDataFrame.
5. Använder folium för att skapa en interaktiv karta baserad på den erhållna geospatiala datan.
"""

import subprocess
import sys
import requests
import pandas as pd
import geopandas as gpd
import folium
from shapely.geometry import Polygon

def install(package):
    """Funktion för att installera paket med pip."""
    subprocess.check_call([sys.executable, "-m", "pip", "install", package])

# Kontrollera och installera nödvändiga bibliotek
required_packages = ["requests", "pandas", "geopandas", "folium"]
for package in required_packages:
    try:
        __import__(package)
    except ImportError:
        install(package)

# ... [Fortsättning från tidigare delar av skriptet] ...

# Fråga användaren efter access_token
access_token = input("Ange ditt access_token: ")

# URL till tjänsten
url = 'https://api.lantmateriet.se/distribution/geodatakatalog/sokning/v1/detaljplan/v2/collections'

# Definiera headers med access_token
headers = {
    'Accept': 'application/json',
    'Authorization': f'Bearer {access_token}'
}

print(headers)

# Göra GET-anropet
response = requests.get(url, headers=headers)

# Kontrollera statuskod och parsar JSON-svaret
if response.status_code == 200:
    data = response.json()
    print("Data hämtad:")

    # Omvandla data till GeoDataFrame
    collections = data['collections']
    bboxes = [collection['extent']['spatial']['bbox'][0] for collection in collections]
    polygons = [Polygon([(bbox[0], bbox[1]), (bbox[2], bbox[1]), (bbox[2], bbox[3]), (bbox[0], bbox[3]), (bbox[0], bbox[1])]) for bbox in bboxes]
    gdf = gpd.GeoDataFrame(geometry=polygons, crs='EPSG:3006')

    # Skapa en interaktiv karta med Folium
    m = folium.Map(location=[60, 15], zoom_start=5)
    folium.GeoJson(gdf).add_to(m)

    # Spara kartan som HTML
    m.save("detaljplaner_karta.html")
else:
    print(f"Misslyckades med att hämta data. Statuskod: {response.status_code}")

