"""# Övning: Befolkningsstatistik

I denna kursdel får du lära dig att hantera och visualisera demografisk data genom ett praktiskt exempel. Du börjar med att hämta data direkt från en webbkälla, vilket är en viktig färdighet när du arbetar med data från olika källor i verkliga projekt. Detta steg visar hur du kan integrera och automatisera datainhämtning i din analysprocess.

Nästa del innefattar omvandling av hämtad JSON-data till en strukturerad pandas dataram. Detta moment är avgörande då det underlättar vidare dataanalys och manipulation. Du får öva på att använda pandas, ett kraftfullt bibliotek för datahantering, för att filtrera, bearbeta och organisera din data.

Slutligen lär du dig att använda matplotlib för att skapa ett histogram som visualiserar fördelningen av befolkningsstorlekar över olika regioner. Genom denna övning får du en bättre förståelse för hur man presenterar data på ett visuellt tilltalande sätt, vilket är en central komponent i alla typer av dataanalys och rapportering.

Denna kursdel ger dig praktiska färdigheter i att hantera verkliga datamängder från början till slut, vilket är ovärderligt för din fortsatta utbildning och framtida arbete inom samhällsplanering och demografistudier.

![image.png](data:image/png;base64,)
"""

import json
import pandas as pd
import matplotlib.pyplot as plt
import requests

# Ange URL för JSON-filen
url = 'https://github.com/soleildeminuit/AI-Samhallsplanering-Course/raw/main/data/raw/000005FF_20240306-152107.json'

# Använd `requests` för att ladda ner filen
response = requests.get(url)

# Se till att begäran var framgångsrik
if response.status_code == 200:
    # Använd json.loads för att ladda JSON-data från texten
    data = json.loads(response.text)
else:
    print(f'Failed to retrieve the file: status code {response.status_code}')
    data = {}

# Extrahera relevanta delar för att skapa en snygg dataram
regions = data['dimension']['Region']['category']['index']
ages = data['dimension']['Alder']['category']['index']
genders = data['dimension']['Kon']['category']['index']
times = data['dimension']['Tid']['category']['index']
values = data['value']

# Initiera listor för att hålla den snygga datan
region_list = []
age_list = []
gender_list = []
time_list = []
value_list = []

# Expandera datan
index = 0
for region in regions:
    for age in ages:
        for gender in genders:
            for time in times:
                # Lägg till varje kombination i listorna
                region_list.append(region)
                age_list.append(age)
                gender_list.append(gender)
                time_list.append(time)
                # Lägg till befolkningsvärdet, hantera saknade värden med None
                value_list.append(values[index] if index < len(values) else None)
                index += 1

# Skapa en DataFrame
tidy_data = pd.DataFrame({
    'Region': region_list,
    'Alder': age_list,
    'Kon': gender_list,
    'Ar': time_list,
    'Befolkning': value_list
})

# Filtrera för total befolkning med kön '1+2' som indikerar kombinerade kön
total_population_data = tidy_data[(tidy_data['Kon'] == '1+2') & (tidy_data['Alder'] == 'totalt')]

# Ta bort dubletter eftersom vi endast är intresserade av den totala befolkningen per region
population_data = total_population_data[['Region', 'Befolkning']].drop_duplicates()

# Plotta histogrammet med 30 klasser
plt.figure(figsize=(14, 7))
plt.hist(population_data['Befolkning'], bins=30, color='skyblue', edgecolor='black')

plt.title('Befolkningsfördelning per region')
plt.xlabel('Befolkning')
plt.ylabel('Antal regioner')
plt.grid(axis='y', alpha=0.7)

plt.show()

