"""
Generera pajdiagram för säsongsmässig fördelning av nyhetsartiklar

Detta skript visualiserar fördelningen av nyhetsartiklar efter årstid från lomma.se.
Vi använder matplotlib för visualisering och anpassade färger inspirerade av FDA:s Pomological Watercolor Collection.
"""

import subprocess
import sys

# Funktion för att kontrollera och installera nödvändiga paket
def check_and_install(package):
    try:
        __import__(package)
    except ImportError:
        subprocess.check_call([sys.executable, "-m", "pip", "install", package])

# Kontrollera och installera pandas och matplotlib
check_and_install('pandas')
check_and_install('matplotlib')

import pandas as pd
import matplotlib.pyplot as plt
from datetime import datetime

def load_data(filepath):
    '''Laddar nyhetsdata från en CSV-fil.'''
    return pd.read_csv(filepath)

def categorize_season(date_str):
    '''Kategoriserar varje nyhetsartikel i en årstid baserat på dess månad.'''
    date_obj = datetime.fromisoformat(date_str[:-6])  # Ta bort tidszonsinformationen för parsing
    month = date_obj.month
    if 3 <= month <= 5:
        return 'Vår'
    elif 6 <= month <= 8:
        return 'Sommar'
    elif 9 <= month <= 11:
        return 'Höst'
    else:
        return 'Vinter'

def generate_pie_chart(data, title, filepath):
    '''Genererar ett pajdiagram för fördelningen av nyhetsartiklar efter årstid.'''
    # Definiera färger inspirerade av FDA Pomological Watercolor Collection
    pomological_colors = {
        'Vår': '#8db600',
        'Sommar': '#f4c430',
        'Höst': '#d2691e',
        'Vinter': '#89cff0'
    }

    season_counts = data['Årstid'].value_counts()
    plt.figure(figsize=(10, 8))
    plt.pie(season_counts, labels=season_counts.index, autopct='%1.1f%%', startangle=140, colors=[pomological_colors[season] for season in season_counts.index])
    plt.title(title, fontsize=16)
    plt.figtext(0.5, 0.01, 'Skapad av: Anders Elias, datakälla: lomma.se', ha='center', fontsize=12)
    plt.savefig(filepath)
    plt.show()  # Visa diagrammet direkt i konsolen

def main():
    data_path = 'https://github.com/soleildeminuit/AI-Samhallsplanering-Course/raw/main/data/raw/lomma_nyheter_iso8601.csv'  # Exempel på lokal sökväg till datafilen
    chart_path = 'news_distribution_by_season_pomological_colors.png'

    df = load_data(data_path)
    df['Årstid'] = df['Datum/Klockslag'].apply(categorize_season)

    generate_pie_chart(df, 'Nyheter från lomma.se', chart_path)

if __name__ == '__main__':
    main()

