"""
Utveckling av Summerad Fruktsamhet per Region och Kön

Detta skript genomför följande steg:
1. Kontrollerar och installerar nödvändiga bibliotek (pandas, matplotlib, seaborn).
2. Laddar och bearbetar en JSON-fil med demografisk data.
3. Definierar dimensioner för region, kön och år.
4. Omvandlar rådatan till en strukturerad pandas DataFrame.
5. Filtrerar datan för att endast inkludera data för män.
6. Skapar ett linjediagram med hjälp av seaborn för att visualisera utvecklingen av summerad fruktsamhet över tid per region.
"""

import json
from itertools import product
import matplotlib.pyplot as plt
import seaborn as sns

# Definiera URL till JSON-filen
file_url = 'https://github.com/soleildeminuit/AI-Samhallsplanering-Course/raw/main/data/raw/000001J4.json'

# Använd requests för att hämta data från URL
response = requests.get(file_url)
if response.status_code == 200:
    raw_data = response.json()
else:
    print(f"Det gick inte att ladda data från URL. Statuskod: {response.status_code}")
    raw_data = {}

# Definiera dimensioner och deras labels baserat på informationen från filen
regions = {"01": "Stockholms län", "03": "Uppsala län", "04": "Södermanlands län", "05": "Östergötlands län", "06": "Jönköpings län", "07": "Kronobergs län", "08": "Kalmar län", "09": "Gotlands län", "10": "Blekinge län", "12": "Skåne län", "13": "Hallands län", "14": "Västra Götalands län", "17": "Värmlands län", "18": "Örebro län", "19": "Västmanlands län", "20": "Dalarnas län", "21": "Gävleborgs län", "22": "Västernorrlands län", "23": "Jämtlands län", "24": "Västerbottens län", "25": "Norrbottens län"}
genders = {"1": "män", "2": "kvinnor"}
years = {str(y): str(y) for y in range(2000, 2023)}

# Extrahera värdena
values = raw_data['value']

# Skapa en lista för att hålla den "tidy" datan
tidy_data = []

# Iterera över varje kombination av region, kön och år och matcha med värden
for i, (region_code, gender_code, year) in enumerate(product(regions, genders, years)):
    tidy_data.append({
        "Region": regions[region_code],
        "Kön": genders[gender_code],
        "År": year,
        "Värde": values[i]
    })

# Konvertera listan till en DataFrame
tidy_df = pd.DataFrame(tidy_data)

# Förbered datan för visualisering genom att filtrera ut en specifik kön för enklare jämförelse
df_male = tidy_df[tidy_df['Kön'] == 'män']

# Ställ in storleken på figuren för visualiseringen
plt.figure(figsize=(14, 8))

# Använda seaborn för att skapa ett linjediagram för att visa utvecklingen över tid för varje region
sns.lineplot(data=df_male, x='År', y='Värde', hue='Region', marker='o')

# Titel och etiketter
plt.title('Utveckling av summerad fruktsamhet för män efter region, 2000-2022', fontsize=14)
plt.xlabel('År', fontsize=12)
plt.ylabel('Summerad fruktsamhet', fontsize=12)
plt.xticks(rotation=45)
plt.legend(title='Region', bbox_to_anchor=(1.05, 1), loc='upper left')

# Visa diagrammet
plt.tight_layout()
plt.show()

